def find_substring_occurrences(text, substring):
    occurrences = []
    start = 0
    while True:
        start = text.find(substring, start)
        if start == -1:
            break
        occurrences.append((start, start + len(substring)))
        start += len(substring)
    return occurrences if occurrences else None

